import React, { Component } from 'react';
import Alertbox from "./alertbox.component";


export default class Donate extends Component {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        setTimeout(() => this.forceUpdate(), 1000);
    }


    render() {
        return (
            <Alertbox />
        )
    }
}
